const defaultState = {

};

export default function handleInfo(state = defaultState, action) {
  console.log('reducer state', state)
  switch(action.type) {
    case 'STARTING_ZIP_CODE':
      return {...state, startingZip: action.data.formValue};
    default:
      return state;
  }
}
